import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Layout/Navbar';
import PrivateRoute from './components/Layout/PrivateRoute';
import Login from './components/Auth/Login';
import Signup from './components/Auth/Signup';
import DashboardPage from './pages/DashboardPage';
import CsvUploadPage from './pages/CsvUploadPage';
import StockCard from './components/Services/StockCard';
import OrderForm from '../src/components/Orders/OrderForm';
import orderRoutes from './routes/orderRoutes.js';
app.use('/api/orders', orderRoutes);
function App() 
{
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/" element={<PrivateRoute><DashboardPage /></PrivateRoute>} />
        <Route path="/dashboard" element={<PrivateRoute><DashboardPage /></PrivateRoute>} />
        <Route path="/order" element={<PrivateRoute><OrderForm /></PrivateRoute>} />         
        <Route path="/market" element={<PrivateRoute><StockCard /></PrivateRoute>} />
        <Route path="/csv-upload" element={<PrivateRoute><CsvUploadPage /></PrivateRoute>} />
      </Routes>
    </BrowserRouter>
  );
}
export default App;
